import React from "react";
import Particles from "react-particles-js";

export default () => (
  <div
    style={{
      position: "relative",
      width: "100%",
    }}
  ><Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 12,
	            "density": {
	                "enable": true,
	                "value_area": 800
	            }
	        },
	        "line_linked": {
	            "enable": false
	        },
	        "move": {
	            "speed": 1,
	            "out_mode": "out"
	        },
	        "shape": {
	            "type": [
	                "image",
	                "circle"
	            ],
	            "image": [
	                {
	                    "src": "https://angular.io/assets/images/logos/angular/angular.png",
	                    "height": 20,
	                    "width": 23
	                },
	                {
	                    "src": "https://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Vue.js_Logo_2.svg/512px-Vue.js_Logo_2.svg.png",
	                    "height": 20,
	                    "width": 20
	                },
	                {
	                    "src": "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1280px-React-icon.svg.png",
	                    "height": 20,
	                    "width": 20
	                }
	            ]
	        },
	        "color": {
	            "value": "#CCC"
	        },
	        "size": {
	            "value": 30,
	            "random": false,
	            "anim": {
	                "enable": true,
	                "speed": 4,
	                "size_min": 10,
	                "sync": false
	            }
	        }
	    },
	    "retina_detect": false
	}} />
  </div>
);
